import Sidebar from '../components/Sidebar.js'
import { useSurveyContext } from '../contexts/SurveyContext.js';
import "./results.css"

import 'bootstrap/dist/css/bootstrap.min.css';
import Container from 'react-bootstrap/Container';
import Col from 'react-bootstrap/Col';
import Row from 'react-bootstrap/Row';



const Results = () => {

    const { surveyData } = useSurveyContext();

    //koodi, joka näyttää jotain vasta kun survey on valittu

    return (
        <>
        {(surveyData) ? 
            <Container fluid className="mx-5 mt-5">
                <Row className="mr-100">
                    <Col md="auto" offset={2}>
                        <Sidebar />
                    </Col>
                    <Col className="text-center resultsSheet">
                        <h5>Results of the <i>{surveyData.surveyTitle}</i> survey</h5>
                    </Col>
                </Row>
            </Container>
            : null}
        </>
    )
};

export default Results;
